var app=angular.module("VotingApp",["ui.bootstrap"]);app.run(function(){});app.controller("VotingAppController",["$rootScope","$scope","$http","$timeout",function(n,t,i){t.refresh=function(){i.get("api/Votes?c="+(new Date).getTime()).then(function(n){t.votes=n},function(){t.votes=undefined})};t.remove=function(n){i.delete("api/Votes/"+n).then(function(){t.refresh()})};t.add=function(n){var r=new FormData;r.append("item",n);i.put("api/Votes/"+n,r,{transformRequest:angular.identity,headers:{"Content-Type":undefined}}).then(function(){t.refresh();t.item=undefined})}}]);